@-moz-document url-prefix("https://www.lostfilm.tv/"), url-prefix("http://www.lostfilm.tv/") {
body, .lstfml, html {
    background-image: url(https://i.ibb.co/pj8qXsX/Blue-Plasma.gif), url(https://i.ibb.co/D5m7TVW/h-1523207183-7762604-160eb1d963.jpg);
    background-repeat: no-repeat;
    background-attachment:fixed;
    background-color: #000 !important;
    background-position: 100% 100%, center;
    background-size: 1280px, 100%;
    background-blend-mode: screen;
}
a:link, a:visited, a:active {
	color: #0099ff !important;
}
a:hover {
    color: #00ffff;
	animation: yadix 1s ease-in-out
}
@keyframes yadix {
	0% {box-shadow: 5px 5px 50px 10px #00beff; border-radius:50px 0px 50px 0; color: #075981;}
}
* {
    background-color: transparent !important;           
	color: #aaa !important;
    border-color: #006BB2 !important;
    -webkit-transition: background-color .3s !important;                                                                 
    -moz-transition: background-color .3s !important;
    -ms-transition: background-color .3s !important;
    -o-transition: background-color .3s !important;
    transition: background-color .3s !important;
}
::-webkit-scrollbar {
    background: -webkit-linear-gradient(40deg , #000000 , #002D45 , #000000 100%)!important;
    width: 5px !important;
}
::-webkit-scrollbar-thumb, .f-similars--in .slick-arrow i {
    background: -webkit-linear-gradient(10deg , #000000 , #0099ff , #000000 100%)!important;
    border-radius: 100px!important;
    border: 0px!important;
}
::-webkit-scrollbar-thumb:hover {
    cursor: pointer !important;
    background: -webkit-linear-gradient(10deg , #075981 , #0099ff , #075981 100%)!important;
    border: 1px solid #0099ff !important;
}
.hor-spacer1, .hor-spacer2, .hor-spacer3, .lstfml .schedule-list th, .more_comments_big, .more_comments {
background: url('data:image/png;base64,') center no-repeat !important;  
    background-size: 100% !important;
    box-shadow: 0 0 50px #00144C;
}
@Keyframes look {
	0% {
	transform: rotate(5deg) scale(0);
	opacity: 0; }
    50% {
	transform: rotate(-5deg) scale(1);
    opacity: 1; }
	100% {
	transform: rotate(0deg); }
}
.header, .left-side, .right-side, .user-pane, #main-left-side, #main-center-side, #main-right-side, #news-image-placeholder, .text-block, .new-movies-block.clearfix, .row, .left-pane, .filter-pane.white, .item.active, .search-dropdown-pane, .link-pane, .filter-pane, .schedule-list, .menu-pane, .movie-parts-list, .social-pane, .select2-selection.select2-selection--single, .private-messages, .user-comments, .lstfml .user-comments .messages-list-box .message-box, .lstfml .left-pane .white-background, .lstfml .text-block.comments-pane, .lstfml .comment-box .body, .lstfml .title-block .menu-pane .item, .write-comment-input, .reply_bubble, .select-box, .lstfml .user-settings .settings-pane .row .radio-box input[type='radio'] + label, .lstfml .pagging-pane.bottom.comments, .f-row, .f-card, img, .f-news--photos, .lstfml #main-left-side .text-block :hover, .f-tabs--item.is-active, .lstfml .footer, .f-similars {
	background: none repeat scroll 0 0 rgba(0, 7, 27, 0.5) !important;
	box-shadow: 0 0 2px #0099ff;	
	border-radius:30px 0px 30px 0;    
    -webkit-animation-name: look; 
    -webkit-animation-duration: 1s
}
h1, h2, .lstfml .text-block.news .body .row .body .title, .search-input, .name, .header, .news-title, .title-ru, .ru, .status, .tab.active, .he1, .message-title, .lstfml .schedule-list th, .write-comment-input, .more_comments {
	color: #00ffff !important;
}
.item, .count, .gamma, .delta, .title-en, .message-text, .reply-btn, .subscr-btn, .abuse-btn {
	color: #009fff !important;
}
.lstfml .text-block.news .body .row .body .text, .text-block.serials-list, .alpha, .next-link.active, .en.small-text, .left-box, .body, .text-block, .left-block, .right-block, .row, .right-part, .text-label, #select2-bday-ba-container, #select2-bmonth-o9-container, #select2-byear-vr-container, #select2-country-oy-container, #select2-city-w2-container, .lstfml .title-block .details-pane, .text, .previous-link.active, .lstfml .select-box select, .padding.news_text_block, .news-text {
